import React from 'react';

const ProductImage = ({ src, alt, className }) => {
    const fallbackImage = '/assets/images/placeholder.jpg';

    const handleError = (e) => {
        e.target.src = fallbackImage;
    };

    return (
        <img
            src={src}
            alt={alt}
            className={className}
            onError={handleError}
        />
    );
};

export default ProductImage;
